const App = () => {

  return (
    <div>
    <h1>Fremtidsmat</h1>
    <div>
      <select class="form-select form-select-lg mb-3" aria-label=".form-select-lg example">
      <option selected>Open this select menu</option>
      <option value="1">Brød og brødmikser</option>
      <option value="2">Matfett og matfettblandinger</option>
      <option value="3">Ferdigretter med grønnsaker og evt. en proteindel eller en karbohydratdel</option>
      </select>
      </div>
    </div>
  )
};



export default App;
